import React, { Component } from 'react';
import Order_Shophop from './order_Shop/order_Shop'
import s from "./content.module.css"

class CONTENT extends Component {
    render() {
        return (
            <div className={s.content}>
                <Order_Shophop />
            </div>
        )
    }
}
export default CONTENT;
